import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Link } from "react-router-dom";
import MyVideo from "../MyVideo";

function App() {
  return (
    <Router>
      <div className="App">
        <Home />
      </div>


      <Switch>
        <Route path="/Video">
          <MyVideo />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
